// Import React and React Bootstrap components
import React from "react";
import { Navbar, Nav, NavDropdown, Button } from "react-bootstrap";

// Define a function component for the navbar
function MyNavbar() {
  return (
    // Use the Navbar component with some props
    <Navbar bg="light" expand="lg"  >
      
      <Navbar.Brand href="#home">
        <img
          src="/my-app/logo2.png"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="Logo"
        />
      </Navbar.Brand>
      
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      
      <Navbar.Collapse id="basic-navbar-nav">
        
        <Nav className="mr-auto">
          <Nav.Link href="#home">الرئيسية</Nav.Link>
          <Nav.Link href="#about">ماذا عنا</Nav.Link>
          
          <NavDropdown title="الباقات" id="basic-nav-dropdown">
            
            <NavDropdown.Item href="#service1">الباقة الأولى</NavDropdown.Item>
            <NavDropdown.Item href="#service2">الباقة الثانية</NavDropdown.Item>
            <NavDropdown.Item href="#service3">الباقة الثالثة</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Button variant="primary" className="justify-content-center">تواصل معانا</Button>
      </Navbar.Collapse>
    </Navbar>
  );
}

// Export the function component
export default MyNavbar;
